params = {
    data: [
        {
            id: 1,
            type: 'a'
        },
        {
            id: 2
        }
    ]
};
// 映射 params.data 结果返回数组
data = match.parse(params, ['data', {
    id: '$$',
    title: 'string',
    type: "$$ || 'abc'"
}]);

映射function
let params = {
    pid: 2,
    id: 3
};

// 映射 function
let data = match.parse(params, {
    pid: 1,
    id: function (data) {
        // this 指向自身 data 指向params
        return data.pid + data.id + this.pid; // 6
    }
});

映射带有临时config
params = {
    pid: 1,
    id: 2,
    cityId: 2
};
data = match.parseConfig(params, {
    id: '$$',
    pid: '$$'
}, {
    autoComplete: true,
    filterUndefined: false
});
expect(data).to.be.eql({
    id: undefined,
    pid: 1,
    cityId: 2
});

data = match.parse(params, {
    id: '$$'
});
expect(data).to.be.eql({
    id: 2
});

data = match.parseConfig(params, {
    id: '$$',
    pid: '$$'
}, {
    ignoreTokenKey: ['id']
});

expect(data).to.be.eql({
    id: '$$',
    pid: 1
});

data = match.parse(params, {
    id: '$$'
});
expect(data).to.be.eql({
    id: 2
});

映射带有类型转换
// boolean 布尔值 'true' 转化为true 'false'转化为false
// Boolean 布尔值 对转化后的值强制类型转换 !!(变量)
// int 数值值 parseInt(x, 10);
// float 书纸值 parseFloat(x, 10);
// string 字符串值 x.toString();
let params = {
    pid: 'false',
    name: 1,
    id: '2',
    city: 1,
    district: '1.56'
};
let data = match.parse(params, {
    pid: '(boolean)$$', // false
    Pid: '(Boolean)$$', // true
    name: '(Boolean)$$', //true
    id: '(int)$$', // 2
    city: '(string)$$', // '1'
    dis: '(float)$$' // 1.56
});

data = match.parse([params], {
    pid: '(boolean)${0.pid}', // false
    Pid: '(Boolean)${0.pid}', //true
    name: '(Boolean)${0.name}', //true
    id: '(int)${0.id}', // 2
    city: '(string)${0.city}', // '1'
    dis: '(float)${0.district}' //1.56
});

params = [
    {
        id: 1,
        type: 2
    },
    {
        id: 2
    }
];
data = match.parse(params, [{
    id: '(string)$$',
    title: 'string',
    type: "$$ || 'abc'"
}]);

match-function.html.body:
/**
 * @description 注册全局函数
 * @params * fn {Function|Array} 注册的全局内容，可以是函数或者函数数组
 * @params * name {string} 注册的函数关键字，用于update remove识别
 */
match.register(fn, name);

/**
 * @description 更新全局函数
 * @params * fn {Function|Array} 注册的全局内容，可以是函数或者函数数组
 * @params * name {string} 更新的函数关键字
 */
match.update(fn, name);

/**
 * @description 删除全局函数
 * @params * name {string} 删除的函数关键字
 */
match.remove(name);
